function onStartJobVacancy(){$.validator.unobtrusive.parse("#frmJobVacancy")}function onSaveJobVacancy(n){ShowMessage(n.success,n.message);n.success&&($("#jobVacancyPartialView").modal("hide"),$("#tblJobVacancy").bootstrapTable("refresh"))}function addUpdateJobVacancy(n){$.ajax({type:"GET",url:"JobVacancy/AddUpdate",data:AddAntiForgeryToken({jobId:n}),success:function(n){$("#jobVacancyPartialView").html(n);$("#jobVacancyPartialView").modal("show")}})}function deleteJobVacancy(n){confirmDialog("Are you sure?",t=>{t&&$.ajax({url:"JobVacancy/DeleteJobVacancy",data:AddAntiForgeryToken({jobId:n}),type:"POST",success:function(n){ShowMessage(n.success,n.message);n.success&&$("#tblJobVacancy").bootstrapTable("refresh")}})})}function loadMedicalOrgs(){var n=$("#medOrgSelect").data("url");$("#medOrgSelect").select2({minimumInputLength:3,multiple:!1,placeholder:"Please type medical title.",dropdownCssClass:"bigdrop",allowClear:!0,dataType:"json",ajax:{url:n,global:!1,data:function(n){return{medicalOrgName:n.term}},processResults:function(n){return console.log(n),{results:$.map(n.returnObject,function(n){return{text:`<div class="text-center text-gray-900 text-small">${n.title} -- ${n.address}</div>`,id:n.medicalOrgId}})}}},escapeMarkup:function(n){return n},templateSelection:formatRepoSelection})}function formatRepoSelection(n){return n.display===undefined?n.text:n.display}function queryJobVacancyParam(n){return n.startDate=$("#StartDate").val(),n.endDate=$("#EndDate").val(),n.isActiveOnly=$("#isActiveOnly").val(),n}function runningFormatter(n,t,i){var r=$("#tblJobVacancy").bootstrapTable("getOptions");return(r.pageNumber-1)*r.pageSize+(1+i)}function setMedicalOrg(n){var t=$("#medOrgSelect").data("select2");console.log(n);n&&t.trigger("select",{data:{text:`${n.medicalName} -- ${n.address}`,id:n.jobVacancyId}})}function searchJobVacancy(){$("#tblJobVacancy").bootstrapTable("refresh",{query:{limit:10,offset:0}})}